def _partially_consume_prefix(self, prefix, column):
        lines = []
        current_line = ""
        current_column = 0
        for char in prefix:
            if char in [' ', '\t']:
                current_line += char
                if char == ' ':
                    current_column += 1
                else:
                    current_column += 4
            elif char == '\n':
                if current_column < column:
                    current_line += char
                    current_column = 0
                else:
                    lines.append(current_line)
                    current_line = ""
                    current_column = 0
            elif current_column < column:
                current_line += char
                current_column += 1
            else:
                lines.append(current_line)
                return ''.join(lines), prefix[len(''.join(lines)):]
        return ''.join(lines), current_line
